import pandas as pd
from calculators.ese_calc import EducationSpecificEmotionsCalculator
from datamodels.camera import OpenFaceDataPoint

def test_calculate():
    calculator = EducationSpecificEmotionsCalculator()
    data_header = list(test_data.columns)
    test_data_list = test_data.values.tolist()
    for i in range(1, len(test_data_list)):
        points = [OpenFaceDataPoint(data_header, test_data_list[i])]
        value = calculator.calculate_dataset(points)
        assert results[i - 1]["boredom"] == value["boredom"]
        assert results[i - 1]["frustration"] == value["frustration"]
        assert results[i - 1]["confusion"] == value["confusion"]
        assert results[i - 1]["delight"] == value["delight"]

